original_question:
Дванадцять квадратів розміром 1 на 1 утворюють прямокутник, як показано. Яка загальна площа заштрихованої області? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Filled portions
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// grid
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

//diagonals
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

question:
Дванадцять квадратів розміром 1 на 1 утворюють прямокутник, як показано. Яка загальна площа заштрихованої області? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Filled portions
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// grid
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

//diagonals
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

original_question:
Колесо, показане на малюнку, обертається двічі, так що числа, на які вказує стрілка, визначаються випадковим чином (кожне число на колесі має однакову ймовірність). Два числа, визначені таким чином, записуються. Перше число ділиться на 4, визначаючи один із залишків 1,2,3, що позначають стовпці шахової дошки, показаної на малюнку. Друге число ділиться на 5, визначаючи один із залишків 1,2,3,4, що позначають рядки шахової дошки. Нарешті, шашка розміщується на квадраті, де цей стовпець і рядок перетинаються. Яка ймовірність того, що шашка буде розміщена на заштрихованому квадраті шахової дошки?

[asy]
unitsize(1cm);
draw(Circle((0,0),2),linewidth(0.7));
draw((1.7,1)--(-1.7,-1),linewidth(0.7));
draw((1.7,-1)--(-1.7,1),linewidth(0.7));
draw((0,2)--(0,-2));
label("1",(0.8,0.5),NW);
label("2",(0.8,-0.5),SW);
label("6",(-0.8,0.5),NE);
label("9",(-0.8,-0.5),SE);
label("3",(-0.7,0),W);
label("7",(0.7,0),E);
draw((-2.8,0)--(-2.1,0),Arrow);
label("Pointer",(-2.8,0),W);
fill((3,0)--(3,1)--(4,1)--(4,0)--cycle,gray(0.7));
fill((3,-2)--(3,-1)--(4,-1)--(4,-2)--cycle,gray(0.7));
fill((4,1)--(4,2)--(5,2)--(5,1)--cycle,gray(0.7));
fill((4,-1)--(4,0)--(5,0)--(5,-1)--cycle,gray(0.7));
fill((5,0)--(5,1)--(6,1)--(6,0)--cycle,gray(0.7));
fill((5,-2)--(5,-1)--(6,-1)--(6,-2)--cycle,gray(0.7));
draw((3,-2)--(3,2)--(6,2)--(6,-2)--cycle,linewidth(0.7));
draw((3,-1)--(6,-1),linewidth(0.7));
draw((3,0)--(6,0),linewidth(0.7));
draw((3,1)--(6,1),linewidth(0.7));
draw((4,-2)--(4,2),linewidth(0.7));
draw((5,-2)--(5,2),linewidth(0.7));
label("1",(3.5,-2),S);
label("2",(4.5,-2),S);
label("3",(5.5,-2),S);
label("1",(3,-1.5),W);
label("2",(3,-0.5),W);
label("3",(3,0.5),W);
label("4",(3,1.5),W);
[/asy]

