Яка найкоротша відстань, яку можна подолати, якщо почати з будь-якої точки $A$, $B$, $C$ або $D$ і відвідати інші три точки один раз?

[asy]
pair A,B,C, D;
A = (-3,3); B = (3,0); C = (0, -4); D = (0,0);
draw(D--B--C--cycle); draw(D--A--B--cycle);draw(D--A--C--cycle);
